The Dukan Method is the result of doctor and nutritionist Pierre Dukan’s 40 years of experience and is one of the most successful dieting tools in the world today.

Meet the official mobile app!

Main features:
• True Weight Calculator;
• Diet Diary: monitor your weight, physical activity and mood;
• Clear recommendations for each day;
• List of allowed foods with tips;
• 350 exclusive recipes (in-app purchase $2.99);
• Food diary;
• Choice of alternating rhythm, from 1-1 to 5-5;
• Record your chest/waist/hip measurements in the diary;
• Store slimming progress photos;
• Option to write notes in the diary;
• Reminders with daily recommendations about walks and diary entries;
• Option to change True Weight;
• Mark your period in the diary and graph;
• Sync with Apple Watch;
• Reminders to drink water, with frequency settings;
• Unique “Emotions” section.

The app uses data from the standard Health app for reading and noting your average weight and kilometres covered/steps taken.

